import React, {Component} from "react";

class File extends Component{
    method(){
        return <h4>Homsi</h4>
    }

    render(){
        const name = 'Nour'
        const name2 = this.method()
        return(
            <h1>{name} {name2}</h1>
            
        )
    }
}

export default File
